import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import {spreadingSquares} from "../src";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
    <spreadingSquares />
  </React.StrictMode>
);
